import React from "react";

const {path: PROJECT_ROOT} = require('app-root-path');


const Navbar = () => {
    const LOGO = String.concat(PROJECT_ROOT, "./src/static/National-Geographic-Logo.svg")
    return (
        <>
        <span>{LOGO}</span>
        </>
    )
}

export  default Navbar;
